import React from "react";
import Button from '@material-ui/core/Button';


const Popup = props => {
  return (
    <div className="popup-box">
      <div className="box">
        <span className="close-icon" onClick={props.toggle}>x</span>
        <label> First name: </label>
        <br/>
        <label> First name: </label>
        <br/>
        <label> First name: </label>
        <br/>
        <label> First name: </label>
        <br/>
        <label> First name: </label>
        <br/>
        <Button variant="contained" color="primary" style={{position:'absolute', right:'0', bottom:'0'}} onClick={props.toggle}>
				Close
        </Button>
        <Button variant="contained" color="primary" style={{position:'absolute', left:'0', bottom:'0', paddingBottom: '10%'}} onClick={props.toggle}>
				Make admin
        </Button>
      </div>
    </div>
  );
};
 
export default Popup;
